(window.webpackJsonpsmartcharts=window.webpackJsonpsmartcharts||[]).push([[12],{315:function(e){e.exports=JSON.parse('{"[symbol] feed is delayed by [delay] minutes":"Данные для [symbol] запаздывают на [delay] мин.","[symbol] market is now opened.":"Рынок [symbol] открыт.","[symbol] market is presently closed.":"Рынок [symbol] в настоящее время закрыт.","A technical momentum indicator that compares a security\'s closing price to its price range over a given time period. The oscillator\'s sensitivity to market movements can be reduced by adjusting the time period or by taking a moving average of the result.":"Технический индикатор темпа, который сравнивает цену закрытия ценной бумаги с диапазоном её цен на протяжении заданного периода времени. Уменьшить чувствительность осциллятора к рыночным движениям можно путём регулирования временного периода или воспользовавшись скользящей средней.","Active":"Активные","Add":"Добавить","Add new template":"Добавить новый шаблон","Add new templates":"Добавить новые шаблоны","All drawings":"Все рисунки","already exists.":"уже существует.","Area":"Область","Available only for \\\\\\"Area\\\\\\" chart type.":"Доступно только для графика \\\\\\"с областями\\\\\\".","Available only for non-tick time intervals.":"Недоступно для тиковых временных интервалов.","Bill Williams introduced the Alligator indicator in 1995. The Alligator is as much a metaphor as it is an indicator. It consists of three lines, overlaid on a pricing chart, that represent the jaw, the teeth and the lips of the beast, and was created to help the trader confirm the presence of a trend and its direction. The Alligator indicator can also help traders designate impulse and corrective wave formations, but the tool works best when combined with a momentum indicator.":"Билл Уильямс представил индикатор «Аллигатор» в 1995 году. «Аллигатор» состоит из трех линий, наложенных на ценовой график, которые представляют челюсть, зубы и губы зверя, и был создан, чтобы помочь трейдерам подтвердить наличие тренда и его направление. С помощью Аллигатора также можно определять образование импульсных и корректирующих волн. Стоит отметить, что этот инструмент лучше всего работает в сочетании с индикатором темпа.","Bollinger Bands can be used to measure the highness or lowness of the price relative to previous trades.":"Полосы Боллинджера измеряют максимум или минимум цены по отношению к предыдущим контрактам.","Box Size":"Размер ячейки","Cancel":"Отмена","Candle":"Свеча","Channel [num]":"Канал [num]","Chart data is not available for this symbol.":"График недоступен для данного актива.","Chart types":"Виды графиков","Charts":"Графики","Clear all":"Очистить все","CLOSED":"ЗАКРЫТО","Color":"Цвет","Continuous":"Непрерывный","Continuous [num]":"Непрерывный [num]","CSV":"CSV","Dark":"Тёмный","day":"дн.","days":"дн.","Developed by Larry Williams, Williams %R is a momentum indicator that is the inverse of the Fast Stochastic Oscillator. Also referred to as %R, Williams %R reflects the level of the close relative to the highest high for the look-back period.":"Диапазон Уильямса (%R), разработанный Ларри Уильямсом, служит индикатором темпа, который противоположен быстрому стохастическому осциллятору. Его также часто называют %R. Индикатор показывает уровень цены закрытия относительно максимума за определенный период.","Developed by Tushar Chande in 1995, Aroon is an indicator system that determines whether a stock is trending or not and how strong the trend is. There are two separate indicators: Aroon-Up and Aroon-Down. A 25-day Aroon-Up measures the number of days since a 25-day high. A 25-day Aroon-Down measures the number of days since a 25-day low.":"Арун – это система индикаторов, разработанная Тушаром Чэндом в 1995 году. Система определяет, развивает ли инструмент какой-либо тренд, а также силу данного тренда. Выделяют две разновидности индикатора: Арун-Вверх и Арун-Вниз. 25-дневный Арун-Вверх измеряет количество дней после 25-дневного максимума. 25-дневный Арун-Вниз измеряет количество дней после 25-дневного минимума.","Display data for a specific date and time":"Показать данные для определенных даты/времени","Display remaining time for each interval":"Показать оставшееся время для каждого интервала","Display the highest and lowest spot price":"Показать максимальную и минимальную спот-цену","Done":"Готово","Download":"Загрузить","Drawing tools":"Ср-ва отображения","Favorites":"Избранное","Fib Fan [num]":"Веер Фибоначчи [num]","Fractals are indicators on candlestick charts that identify reversal points in the market. Traders often use fractals to get an idea about the direction in which the price will develop. A fractal will form when a particular price pattern happens on a chart.":"Фракталы - это индикаторы на графике японских свечей, которые определяют уровни разворота на рынке. Трейдеры часто используют фракталы, чтобы определить направление, в котором будет двигаться цена. Фракталы образуются при появлении на графике определённых фигур.","H":"Мак","Highest and lowest spot":"Самая высокая и самая низкая спот-котировки","Historical data mode":"Исторические данные","Hollow":"Полый","Horizontal [num]":"Горизонталь [num]","hour":"час.","hours":"час.","Indicators":"Индикаторы","Interval duration":"Продолжительность интервала","Kagi":"Каги","L":"Мин","Language":"Язык","Last digits stats for latest 1000 ticks on":"Статистика последних десятичных в последних 1000 тиков для","Light":"Светлый","Line [num]":"Линия [num]","Line Break":"Линейный прорыв","MACD is a trading indicator used in technical analysis of stock prices. It is supposed to reveal changes in the strength, direction, momentum, and duration of a trend in a stock\'s price.":"MACD – это индикатор, использующийся для технического анализа цены акций. Он выявляет изменение силы, направления, темпа и продолжительности тренда, отмечающегося на цене акции.","Markets":"Рынки","minute":"мин.","minutes":"мин.","Momentum":"","Moving averages":"","Network status":"Статус сети","No results for":"Не найдено результатов для","OHLC":"OHLC","Opens in:":"Откроется через:","Others":"","Overwrite":"Переписать","Platform settings":"Настройки платформы","PNG":"PNG","Point & Figure":"Крестики-нолики","Price Lines":"Линии цены","Range":"Диапазон","Range Bars":"Рейндж бары","Ray [num]":"Рентген [num]","Rectangle [num]":"Прямоугольник [num]","Renko":"Ренко","Reset":"Сбросить","Result":"Результат","Retrieving Chart Data...":"Получение данных графика...","Retrieving Chart Engine...":"Получение данных из Chart Engine...","Retrieving Market Symbols...":"Получение рыночных данных...","Retrieving Trading Times...":"Получение времени торговли...","Reversal":"Разворот","Reversal Percentage":"Процент разворота","Right click to delete":"Щелкните правой кнопкой мыши, чтобы удалить","Right click to manage":"Щелкните правой кнопкой мыши, чтобы управлять","Saved templates":"Сохраненные шаблоны","Search...":"Поиск...","Select language":"Выберите язык","Select theme":"Выбрать тему","Settings":"Настройки","Size":"Размер","Streaming for [symbol] is not available due to license restrictions":"Потоковые котировки для [symbol] недоступны из-за лицензионных ограничений","Templates":"Шаблоны","The Average Directional Movement Index index (ADX) was developed in 1978 by J. Welles Wilder as an indicator of trend strength in a series of prices of a financial instrument ADX will range between 0 and 100. Generally, ADX readings below 20 indicate trend weakness, and readings above 40 indicate trend strength.":"Индекс среднего направления (ADX) впервые был предложен в 1978 Дж. Уэллсом Уайлдером в качестве индикатора силы тренда в серии котировок финансового инструмента. ADX рассчитывается по шкале от 0 до 100. Как правило, если ADX опускается ниже 20, это означает слабый тренд, а рост показателя выше 40 говорит о силе тренда.","The Awesome Oscillator is an indicator used to measure market momentum. AO calculates the difference of a 34 Period and 5 Period Simple Moving Averages. The Simple Moving Averages that are used are not calculated using closing price but rather each bar\'s midpoints. AO is generally used to affirm trends or to anticipate possible reversals.":"Чудесный осциллятор – это индикатор, измеряющий темп рынка. Чудесный осциллятор (AO) рассчитывает разницу значений простой скользящей средней за 34 периода и 5 периодов. Применяемые простые скользящие средние не учитывают цену закрытия, но учитывают средние значения каждого столбика на графике. Как правило, Чудесный осциллятор применяется для подтверждения тренда и предсказания возможных разворотов.","The Commodity Channel Index (CCI) is a versatile indicator that can be used to identify a new trend or warn of extreme conditions.":"Индекс товарного канала (CCI) – гибкий индикатор, призванный определить новый тренд или предупредить о формировании экстремальных условий.","The Detrended Price Oscillator (DPO) helps to identify price cycles without the influence of short- and long-term trends. The DPO compares a simple moving average to a historical pricenear the middle of a specified period. It also shows the peaks and drops over that particular period, making it easier to predict buy points.":"Осциллятор бестрендовой цены (DPO) помогает идентифицировать ценовые циклы без учета краткосрочных и долгосрочных трендов. DPO сравнивает простую скользящую среднюю с исторической ценой около середины указанного периода. Он также показывает пики и падения за этот конкретный период, что упрощает прогнозирование точек покупки.","The Donchian Channel is an indicator used in market trading developed by Richard Donchian. It is formed by taking the highest high and the lowest low of the last n periods. The area between the high and the low is the channel for the period chosen.":"Канал Дончиана – это индикатор, разработанный Ричардом Дончианом и применяемый для торговли на рынке. Индикатор основан на максимуме и минимуме за последние n периодов. Промежуток между максимумом и минимумом является каналом за выбранный период.","The Gator Oscillator helps to detect trend changes in the market price. Based on the Alligator indicator, the Gator plots 2 histograms on either side of the zero line. The sleeping phase (absence of a trend) is when the bars on both sides are red. The awakening phase (formation of a trend) is when there are red and green bars on both sides. When there are green bars on both sides, it indicates the eating phase (trend strengthening). A solitary red bar appearing after the eating phase indicates the beginning of the sated phase (trend approaching its end).":"Осциллятор Gator помогает обнаруживать изменения тренда в рыночной цене. Основываясь на индикаторе Аллигатор, Gator строит 2 гистограммы по обе стороны от нулевой линии. Фаза сна (отсутствие тренда) - это когда столбцы с обеих сторон красные. Фаза пробуждения (формирование тренда) - с обеих сторон появляются красные и зеленые столбцы. Зеленые столбцы с обеих сторон указывают на фазу питания (усиление тренда). Одиночный красный столбик, появляющийся после фазы приема пищи, сигнализирует о начале фазы насыщения (тренд приближается к своему концу).","The Ichimoku Cloud, also known as Ichimoku Kinko Hyo, is a versatile indicator that defines support and resistance, identifies trend direction, gauges momentum and provides trading signals. Ichimoku Kinko Hyo translates into “one look equilibrium chart”.":"Облако Ишимоку, также известное как Ichimoku Kinko Hyo, является универсальным индикатором, который определяет поддержку, сопротивление, направление тренда, измеряет темп и предоставляет торговые сигналы. Ichimoku Kinko Hyo переводится как \\"диаграмма равновесия одного взгляда\\".","The Moving Average (MA) helps to identify the overall market trend by filtering out short-term price fluctuations. Using historical data, it calculates the average price over a specific period and plots a line on the chart. If the MA line moves upwards, it’s an indicator of an uptrend, a downtrend if it moves downwards. A buy signal occurs when the price moves above the MA line.":"Скользящее среднее (MA) помогает определить общую рыночную тенденцию, отфильтровывая краткосрочные колебания цен. Используя исторические данные, индикатор рассчитывает среднюю цену за определенный период и строит линию на графике. Если линия MA движется вверх, это показатель восходящего тренда, а если он движется вниз - нисходящего. Сигналом на покупку может служить движение цены выше линии МА.","The Moving Average Envelope (MAE) helps to identify strong price movement that indicates the start of a trend. The MAE creates a moving average line as well as 2 bands around it. In theory, when the market price touches the upper or lower bands, a trend reversal will occur, indicating a buy signal.":"Конверт скользящих средних (MAE) помогает определить сильное ценовое движение, которое указывает на начало тренда. MAE создает линию скользящего среднего, а также 2 полосы сверху и снизу от нее. Теоретически, когда рыночная цена касается верхней или нижней полосы, произойдет разворот тренда, что служит сигналом к покупке.","The parabolic SAR is calculated almost independently for each trend in the price. When the price is in an uptrend, the SAR emerges below the price and converges upwards towards it. Similarly, on a downtrend, the SAR emerges above the price and converges downwards. At each step within a trend, the SAR is calculated one period in advance.":"Параболическая система SAR (SAR) рассчитывается практически индивидуально для каждого тренда. Когда цена демонстрирует восходящий тренд, SAR находится ниже цены и стремится вверх. Аналогичным образом, когда цена демонстрирует нисходящий тренд, SAR находится выше цены и стремится вниз. На каждом этапе тренда SAR рассчитывается на один период вперёд.","The Price Rate-of-Change (ROC) indicator displays the difference between the current price and the price x-time periods ago. The difference can be displayed in either points or as a percentage.":"Индикатор Скорость изменения цены (ROC) показывает разницу между текущей ценой и ценой x периодов назад. Разница может быть отображена в пунктах или процентах.","The Rainbow Moving Average (RMA) displays several moving average lines simultaneously. When the lines intersect, it’s an indicator of price reversal and the angle of the lines are helpful to predict the trend strength. The steeper the curve, the stronger the trend. When the price crosses the moving average lines from below, it signals an upward trend. When the price crosses the moving average lines from above, it signals a downward trend. The RMA is easier to use compared to using several different moving average indicators at once.":"Радужная скользящая средняя (RMA) отображает несколько линий скользящей средней одновременно. Пересечение линий служит индикатором разворота цены, а угол линий помогает предсказать силу тренда - чем круче кривая, тем сильнее тренд. Когда цена пересекает линии скользящей средней снизу, это сигнализирует о восходящем тренде, а когда цена пересекает линии скользящей средней сверху - о нисходящем тренде. RMA проще в использовании по сравнению с применением нескольких разных индикаторов скользящей средней одновременно.","The Relative Strength Index (RSI) was published by J. Welles Wilder. The current price is normalized as a percentage between 0 and 100. The name of this oscillator is misleading because it does not compare the instrument relative to another instrument or set of instruments, but rather represents the current price relative to other recent pieces within the selected lookback window length.":"Индекс относительной силы (RSI) разработан Дж. Уэллсом Уайлдером. Текущая цена нормализована в виде процента от 0 до 100. Название индикатора может ввести в заблуждение, так как он не сравнивает инструмент по отношению к другому инструменту или ряду инструментов, а отображает текущую цену по отношению к другим недавним ценам за выбранный период.","The Stochastic Momentum Index (SMI) helps to identify overbought or oversold conditions in the market and to predict bearish or bullish trends. It calculates the distance between the current closing price and the median of the high/low range, and displays 2 lines on the chart: the first (known as %K) represents the price movement while the second (known as %D) is a moving average of the first line. If the closing price is higher than the median of the high/low range, the SMI returns a positive value. If the closing price is lower than the average price, a negative value is returned. Values above 40 indicate a bullish trend while values below -40 indicate a bearish trend.":"Индекс Стохастического Моментума (SMI) помогает идентифицировать условия перекупленности или перепроданности на рынке и прогнозировать медвежьи или бычьи тренды. Он рассчитывает расстояние между текущей ценой закрытия и медианой диапазона максимума/минимума, и отображает 2 линии на графике: первая (известная как %K) представляет движение цены, а вторая (известная как %D) представляет собой скользящее среднее первой линии. Если цена закрытия выше, чем медиана диапазона максимума/минимума, SMI возвращает положительное значение. Если цена закрытия ниже средней цены, возвращается отрицательное значение. Значения выше 40 указывают на бычий тренд, а значения ниже -40 указывают на медвежий тренд.","Themes":"Темы","There are no favorites yet.":"Нет записей в избранном.","tick":"тик.","Tick interval only available for \\\\\\"Area\\\\\\" Chart type.":"Тиковый интервал доступен только для графика \\\\\\"с областями\\\\\\".","Time interval":"Интервал","Trend":"","Trend [num]":"Тренд [num]","Try checking your spelling or use a different term":"Проверьте орфографию или используйте другой термин","Underlying Assets":"Основные активы","Up to 2 active indicators allowed.":"","Up to 5 active indicators allowed.":"До пяти индикаторов одновременно.","Vertical [num]":"Вертикаль [num]","Volatility":"","Would you like to overwrite it?":"Хотите перезаписать?","You have no active drawings yet.":"У вас пока нет активных рисунков.","You have no active indicators yet.":"У вас пока нет активных индикаторов.","You have no saved templates yet.":"У Вас пока нет сохранённых шаблонов.","Zig Zag helps to identify trend reversals and filters out relatively small price movements by determining the support and resistance levels of the market. It accepts a percentage of deviation as the input and displays a line if the price change is larger than the percentage of deviation. Zig Zag ignores any sideways movement and is useful to filter out “market noise”.":"Zig Zag помогает идентифицировать развороты тренда и отфильтровывает относительно небольшие ценовые движения, определяя уровни поддержки и сопротивления рынка. Он принимает процент отклонения в качестве входных данных и отображает линию, если изменение цены больше, чем процент отклонения. Zig Zag игнорирует любые боковые движения и полезен для фильтрации \\"рыночного шума\\".","Zoom in":"Увеличить","Zoom out":"Уменьшить"}')}}]);
